import React from "react";

const BestPokemon = () => {
  // Con Arrow Function
  return (
    <ul className="listaPokemon">
      {pokemonNames.map((nombre, index) => {
        return <li key={index}>{nombre}</li>;
      })}
    </ul>
  );
};

const pokemonNames = ["Squirtle", "Bulbasaur", "Charmander"];

export default BestPokemon;

